import React from "react";
// import Nav from "./Nav"
import "./Footer.css";
// import whiteLong from '../../img/whiteLong.png'

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-container">
        <div className="row text-center pt-5 pb-5 ">

          <div>
            <a className='footer-buttons' href="mailto: Info@C-3.co">Contact Us</a>
          </div>
          <div>
            <a className='footer-buttons' href="C-3.co">Visit Parent Website</a>
          </div>
          <div>
            <a className='footer-buttons' href="C-3.co">About Us</a>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Footer;
